import React from "react";
import PopupWithForm from "../PopupWithForm/PopupWithForm";

function InfoTooltip({
  isOpen,
  onClose,
  icon,
  title
}) {

  return (
    <PopupWithForm
      isOpen={isOpen}
      onClose={onClose}
      title={title}
      icon={icon}
    >
      <img src={icon}></img>
      <h2>{title}</h2>
    </PopupWithForm>
  )
}

export default InfoTooltip;
